import axios from "axios"
export default{
    name:'mixin',
    data() {
        return {
            productionData:'',
            item:''
        }
    },
    methods: {
        addItem(){
            axios.get('/store_item.json').then(
                response => {
                    this.productionData = response.data.goodss
                    console.log(this.productionData);
                },
                error => {
                    alert(error.message)
                }
            )
        },
        queryDataId(id,productionData){
            for (var i = 0; i < productionData.length; i++) {
                if (id==productionData[i].id)
                return this.item = productionData[i]; 
            }
        }
    },
    mounted() {
        this.addItem()
    },
}
